import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import { Dropdown, Menu} from 'semantic-ui-react'

class Search extends Component {
  state = {
    JobList :[{"title":"Software Engineer", "endDate":"May 10 2019", "location":"San Francisco", "description": ["Experience working with a large codebase on a cross functional team", "Strong knowledge of SQL, Bachelor’s degree in Computer Science, computer engineering, electrical engineering OR equivalent work experience"], "starredNumber":10},
                                                                       {"title":"Product Manager", "endDate":"June 1 2019", "location":"Los Angeles", "description": ["Strong knowledge of common back-end Web technologies (such as Ruby on Rails, Python, etc) in a production environment", "An ability to balance a sense of urgency with shipping high quality and pragmatic solutions"], "starredNumber": 23},
                                                                       {"title":"Senior Software Engineer", "endDate":"May 20 2019", "location":"Chicago", "description": ["Experience working with a large codebase on a cross functional team", "Strong knowledge of SQL, Bachelor’s degree in Computer Science, computer engineering, electrical engineering OR equivalent work experience"], "starredNumber":16}],
    SelectedJob : ''

  }

  render() {

	    return (
	      <div className = "ui grid">
          <div className="two wide column account_container">
          </div>
          <div className="four wide column account_container">
            <select class="ui search dropdown">
              <div>
                {this.state.JobList.map(item => (
                  <option>{item.title}</option>
                ))}
              </div>
            </select>
          </div>
          <div className="eight wide column account_container">
          </div>
          <div className="two wide column account_container">
          </div>

	      </div>
	    )
  }

}

export default Search
